import React from 'react';
import {Switch, Route} from 'react-router-dom';
import GlobarFeed from './globalFeed';
import Article from './articale';

export default () => {
    return (
        <Switch>
            <Route path='/' component={GlobarFeed} exact  ></Route>
            <Route path='/articles/:slug' component={Article} ></Route>

        </Switch>
    )
}